import{_ as l,c as a,o as t,bl as r}from"./chunks/framework.DFj1EtU5.js";const d=JSON.parse('{"title":"组件总览","description":"","frontmatter":{},"headers":[],"relativePath":"guide/index.md","filePath":"guide/index.md"}'),i={name:"guide/index.md"};function n(o,e,s,h,c,m){return t(),a("div",null,[...e[0]||(e[0]=[r('<h1 id="组件总览" tabindex="-1">组件总览 <a class="header-anchor" href="#组件总览" aria-label="Permalink to “组件总览”">​</a></h1><p>Minilo-UI 是基于 Element Plus 二次封装的 Vue3 组件库，提供了一系列开箱即用的业务组件。</p><h2 id="特性" tabindex="-1">特性 <a class="header-anchor" href="#特性" aria-label="Permalink to “特性”">​</a></h2><ul><li>🎨 <strong>基于 Element Plus</strong> - 继承 Element Plus 的所有特性</li><li>🚀 <strong>开箱即用</strong> - 封装常见业务场景，减少重复代码</li><li>📱 <strong>响应式设计</strong> - 组件自动适配不同屏幕尺寸</li><li>🎯 <strong>TypeScript</strong> - 完整的类型定义支持</li><li>⚡ <strong>高性能</strong> - 性能优化，防抖处理，智能渲染</li><li>🔌 <strong>自动按需引入</strong> - 支持 unplugin-vue-components，无需手动导入</li></ul><h2 id="组件列表" tabindex="-1">组件列表 <a class="header-anchor" href="#组件列表" aria-label="Permalink to “组件列表”">​</a></h2><h3 id="数据展示" tabindex="-1">数据展示 <a class="header-anchor" href="#数据展示" aria-label="Permalink to “数据展示”">​</a></h3><ul><li><strong><a href="/minilo/components/chart.html">MlChart 图表组件</a></strong> - 基于 ECharts 封装的响应式图表组件，支持自动响应式、主题切换、空状态处理等功能。</li><li><strong><a href="/minilo/components/detail.html">MlDetail 详情组件</a></strong> - 基于 el-descriptions 封装的详情展示组件，支持下拉数据回显、自定义插槽、提示信息等功能。</li></ul><h3 id="表单组件" tabindex="-1">表单组件 <a class="header-anchor" href="#表单组件" aria-label="Permalink to “表单组件”">​</a></h3><ul><li><strong><a href="/minilo/components/search.html">MlSearch 搜索组件</a></strong> - 响应式搜索表单组件，支持多种输入类型、自适应布局、展开收起等功能。</li><li><strong><a href="/minilo/components/button.html">MlButton 按钮组件</a></strong> - 基于 el-button 封装的按钮组件，提供统一的按钮样式和行为。</li><li><strong><a href="/minilo/components/number-range-input.html">MlNumberRangeInput 数值范围输入框</a></strong> - 基于 el-input 封装的数值范围输入组件，支持最小值和最大值输入，适用于价格区间、年龄范围等场景。</li></ul><h3 id="选择器组件" tabindex="-1">选择器组件 <a class="header-anchor" href="#选择器组件" aria-label="Permalink to “选择器组件”">​</a></h3><ul><li><strong><a href="/minilo/components/tree-select.html">MlTreeSelect 树形选择</a></strong> - 树形选择组件，支持单选、多选、搜索等功能，可内嵌在页面中使用。</li><li><strong><a href="/minilo/components/tree-select-dialog.html">MlTreeSelectDialog 树形选择对话框</a></strong> - 将树形选择集成到对话框中，适用于弹窗场景的树形数据选择。</li><li><strong><a href="/minilo/components/tree-select-drawer.html">MlTreeSelectDrawer 树形选择抽屉</a></strong> - 将树形选择集成到抽屉中，适用于侧边栏场景的树形数据选择。</li></ul><h3 id="数据组件" tabindex="-1">数据组件 <a class="header-anchor" href="#数据组件" aria-label="Permalink to “数据组件”">​</a></h3><ul><li><strong><a href="/minilo/components/search-table.html">MlSearchTable 搜索表格组件</a></strong> - 集成搜索和表格的复合组件，自动处理数据请求、分页、排序等功能。</li><li><strong><a href="/minilo/components/virtual-list.html">MlVirtualList 虚拟列表组件</a></strong> - 高性能虚拟滚动列表，支持定高/不定高、分页/无分页，最多只渲染 10 个 DOM 节点。</li></ul><h2 id="技术栈" tabindex="-1">技术栈 <a class="header-anchor" href="#技术栈" aria-label="Permalink to “技术栈”">​</a></h2><ul><li><strong>Vue 3</strong> - 渐进式 JavaScript 框架</li><li><strong>TypeScript</strong> - JavaScript 的超集，提供类型安全</li><li><strong>Element Plus</strong> - 基于 Vue 3 的组件库</li><li><strong>ECharts</strong> - 强大的数据可视化库</li><li><strong>VueUse</strong> - Vue Composition API 工具集</li></ul><h2 id="开始使用" tabindex="-1">开始使用 <a class="header-anchor" href="#开始使用" aria-label="Permalink to “开始使用”">​</a></h2><p>查看 <a href="/minilo/guide/getting-started.html">快速开始</a> 了解如何在项目中使用 Minilo-UI。</p>',17)])])}const u=l(i,[["render",n]]);export{d as __pageData,u as default};
